import React from 'react';

function Program() {
    return (
        <body>
            <div className='internship'>
                <h1>스타트업 인턴십</h1>
                <p>
                    유코브는 스타트업에서 인턴을 하며<br/>
                    단원들과 함께 프로젝트를 진행하는 프로그램입니다.
                </p>
            </div>
            <div className='project'>
                <h1>미니 프로젝트</h1>
                <p>A - Z까지 만들어가는 다양한 미니 프로젝트</p>
            </div>

        </body>

    )


}

export default Program;
